import Cookies from "js-cookie";
//import { useHistory } from "react-router-dom";
import { createBrowserHistory } from "history";

const Logout = () => {
  const history = createBrowserHistory();
  Cookies.remove("jwt");
  history.push("/home");
};

export default Logout;
